import githubMark from '../github-mark.png';

function Footer() {
    return (
        <footer>
            <div className="footer">
            <a href="https://github.com/keberlea">
                <img src={githubMark} alt="Github logo" className="github-logo"/>
            </a>

                <p>Â© 2021 Alicia Keberle</p>
            </div>
        </footer>
    )
}

export default Footer;
